import React from "react";
import { Grid } from "@mui/material";
import Achievement from "./Achievement";

const Dashboard = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} md={4}>
        <Achievement />
      </Grid>
    </Grid>
  );
};

export default Dashboard;
